import React, { useState, useEffect } from "react";
import axios from "axios";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import { Button, Label, TextInput, Card } from "flowbite-react";

import { Register } from "./components/Register";
import { Dashboard } from "./components/Dashboard";
import { NavbarRC } from "./components/Navbar";
import { Right } from "./components/Right";
import { KubeFlow } from "./components/KubeFlow";
import { KubeSh } from "./components/KubeSh";

export const Auth = ({ onAuthenticate }) => {
  const [credentials, setCredentials] = useState({ email: "", password: "" });

  const handleChange = (e) => {
    setCredentials({ ...credentials, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post("http://localhost:5000/login", credentials);
      if (response.data.token) {
        localStorage.setItem("token", response.data.token);
        onAuthenticate(true);
      }
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <div className="flex justify-center items-center h-screen">
    <div className="vh-100 d-flex align-items-center justify-content-center">
      <Card className="p-5 shadow-lg" style={{ maxWidth: '400px' }}>
        <form onSubmit={handleSubmit}>
          <Label htmlFor="email">Email Address</Label>
          <TextInput
            id="email"
            name="email"
            placeholder="name@kubehub.com"
            required
            type="email"
            value={credentials.email}
            onChange={handleChange}
            className="mb-3"
          />
          <Label htmlFor="password">Password</Label>
          <TextInput 
            id="password" 
            name="password" 
            placeholder="••••••••"
            required 
            type="password"
            value={credentials.password}
            onChange={handleChange}
            className="mb-3"
          />
          <Button type="submit">Log In</Button>
        </form>
      </Card>
    </div>
    </div>
  );
};

function App() {
  const [authenticated, setAuthenticated] = useState(false);

  useEffect(() => {
    const checkAuthentication = () => {
      const storedToken = localStorage.getItem("token");
      setAuthenticated(!!storedToken);
    };

    checkAuthentication();
  }, []);

  return (
    <div style={{ backgroundColor: "black", height: "100vh", width: "100vw" }}>
      <Router>
        {authenticated ? (
          <>
            <NavbarRC />
            <div className="flex">
              <div className="w-4/5">
                <Switch>
                  <Route exact path="/" component={Dashboard} />
                  <Route path="/dashboard" component={Dashboard} />
                  <Route path="/kubeflow" component={KubeFlow} />
                  <Route path="/kubesh" component={KubeSh} />
                </Switch>
              </div>
              <div className="w-1/5">
                <Right />
              </div>
            </div>
          </>
        ) : (
          <Switch>
            <Route exact path="/">
              <Auth onAuthenticate={setAuthenticated} />
            </Route>
            <Route path="/register" component={Register} />
          </Switch>
        )}
      </Router>
    </div>
  );
}

export default App;
